import React from "react";
import {FormButton} from "../components/forms/Button";

export const Footer = () => {
  return (
    <footer className={"footer"}>
      <div className={"auth-bg"}
           style={{
             backgroundImage: `url(${require('../assets/—Pngtree.png')})`,
             backgroundPosition: 'center',
             backgroundSize: 'cover',
             backgroundRepeat: 'no-repeat',
           }}
      >
        <div className={"d-flex flex-column align-items-center col-md-12 justify-content-center"}>
          <div className={'sub-footer-holder'}>
            <div className={"footer-info"}
                 style={{
                   backgroundImage: `url(${require('../assets/—Pngtree.png')})`,
                   backgroundPosition: 'center',
                   backgroundSize: 'cover',
                   backgroundRepeat: 'no-repeat',
                 }}
            >
              <div className={'big-title '}>
                Get started entering various raffles and winning
              </div>
              <div className={'col-md-4'}>
                <FormButton title={"Start bidding to enter raffle"} />
              </div>

            </div>
          </div>
        </div>
      </div>
    </footer>
  )
}
